import React from "react";

const Begruessung = () => {
  const today = new Date();

  if (today.getHours() <= 10) {
    return <h1>Guten Morgen!</h1>;
  } else if (today.getHours() > 10 && today.getHours() < 18) {
    return <h1>Guten Tag!</h1>;
  } else if (today.getHours() >= 18) {
    return <h1>Guten Abend!</h1>;
  }
};

const TaeglicheEingabe = () => {
  const eingaben = localStorage.getItem("eingaben")
    ? JSON.parse(localStorage.getItem("eingaben"))
    : [
        {
          letzteEingabe: new Date(),
          streak: 1,
        },
      ];

  const test = [
    {
      letzteEingabe: new Date(),
      streak: 1,
    },
  ];

  return (
    <div>
      <p>Deine Letzte Eingabe war am {eingaben.letzteEingabe}.</p>
      <p>
        Deine Streak ist {test.streak}
        {eingaben.streak}.
      </p>
    </div>
  );

  // if (!Window.localStorage) {
  //   const eingaben = [
  //     {
  //       letzteEingabe: new Date(),
  //       streak: 1,
  //     },
  //   ];
  // } else {
  //   const eingaben = Window.LocalStorage;
  // }
};

const Startseite = () => {
  return (
    <div>
      <Begruessung />
      <TaeglicheEingabe />
    </div>
  );
};

export default Startseite;
